The Ultimate Easter Puzzler is a stunning collection of OVER 100 Jigsaws, Spot the Differences, Rotating Tiles and many more gorgeous and unique puzzles. With 4 levels of difficulty from Easy to Medium, Hard to Extreme there are puzzles galore for all the family to enjoy. So sit back, relax and enjoy these terrific brain teasers, hour after hour, year after year, alone or with family and friends.


Features:
-Play over 100 amazingly fun and unique puzzles.
-Piece together jigsaws for all levels of ability.
-Challenge yourself or others with festive brain teasers.
-Share the fun with the whole family.


